import Nav from 'react-bootstrap/Nav';

function StackedNavbar(props) {
  const items = props.items.split(', ');

  const createNavLink = (item) => {
    return(<Nav.Link key={item} style={{textAlign: 'left', color: 'white'}} className='highlight-text'>{item}</Nav.Link>);
  }

  return (
    <div className='stackedNavbar'>
      <Nav defaultActiveKey="/home" className="flex-column" style={{margin: '20px 20px 20px 20px'}}>
        <Nav.Item style={{textAlign: 'left'}}> Projects
        {items.map((item) => createNavLink(item))}
        </Nav.Item>
